import axios from 'axios';

const API_BASE_URL = 'http://localhost:8080';

const apiService = {
    createClient: (client) => axios.post(`${API_BASE_URL}/clients`, client),

    checkedName: (name) => axios.post(`${API_BASE_URL}/clients/check-name`, {name}),
    checkedSurname: (surname) => axios.post(`${API_BASE_URL}/clients/check-surname`, {surname}),
    checkedEmail: (email) => axios.post(`${API_BASE_URL}/clients/check-email`, {email}),
    checkedPassword: (password) => axios.post(`${API_BASE_URL}/clients/check-password`, {password}),

    getQRCode: (id) => axios.get(`${API_BASE_URL}/qrcodes/${id}`),

    postTicket: (ticket) => axios.post(`${API_BASE_URL}/tickets`, ticket),

    getClient: (id) => axios.get(`${API_BASE_URL}/clients/${id}`),
    deleteClient: (id) => axios.delete(`${API_BASE_URL}/clients/${id}`),
    loginClient: (clientInfo) => axios.post(`${API_BASE_URL}/clients/login`, clientInfo)

}




export default apiService;
